const tableRow = () => {
	return (
			<tr>
			    <td>23 იანვ.</td>
			    <td>2 ლარი</td>
			    <td>100X</td>
			    <td>5 კაციანი</td>
			    <td><img src="images/user.svg" alt="user"/>ნოდარა ,ელდარა ,ემზარა,ზაირა,მერება</td>
			    <td>10</td>
			    <td>5000 ლარი</td>
			</tr>
	)
}


const tableList = () => {
	return (
		<div className="list_table mt-2">
			<table className="text-center" style={{width:'100%'}}>
			  <tr>
			    <th>თარიღი</th>
			    <th>ღირებული</th>
			    <th>რა X</th>
			    <th>რაოდენობა</th>
			    <th>მონაწილეები</th>
			    <th>ადგილები</th>
			    <th>მოგებული</th>
			  </tr>
			  {tableRow()}
			</table>			
		</div>
	)
}

export {tableList}
